const INITIAL_STATE = {
    collections: [
        {
            title: 'Earrings',
            id: 1,
            linkUrl: 'earrings'
        },
        {
            title: 'Necklace',
            id: 2,
            linkUrl: 'necklace'
        },
        {
            title: 'Choker',
            id: 3,
            linkUrl: 'choker'
        }
    ]
}

const directoryReducer = (state = INITIAL_STATE, action) => {
    switch(action.type) {
        default:
            return state;
    }
}

export default directoryReducer
